import React from 'react' 


const ToDo = (props) => {

    return (
        <ul>
            {this.props.list.map(item => 
                (
                    <li>
                       <span> {item.itemName} </span> 
                       <span> {item.itemChecked} </span> 
                    </li>
                ))}
        </ul>
    )



}











export default ToDoList;
